pragma solidity >=0.5.16;

import "./Token.sol";


contract owned {
    constructor() public { owner = msg.sender; }
    address payable owner;

    // This contract only defines a modifier but does not use
    // it: it will be used in derived contracts.
    // The function body is inserted where the special symbol
    // `_;` in the definition of a modifier appears.
    // This means that if the owner calls this function, the
    // function is executed and otherwise, an exception is
    // thrown.
    modifier onlyOwner {
        require(
            msg.sender == owner,
            "Only owner can call this function."
        );
        _;
    }


}

contract Factory is owned{
    event TokenCreated(address tokenAddress);

    modifier costs(uint price) {
        if (msg.value >= price) {
            _;
        }
    }

    uint price;

    constructor(uint initialPrice) public { price = initialPrice; }


    function deployNewToken(string memory name, string memory symbol, uint256 totalSupply, address issuer) 
    public payable costs(price) returns (address tokenAddress) {
        Token t = new Token(name, symbol, totalSupply, issuer);
        emit TokenCreated(address(t));
        return address(t);
    }

    function changePrice(uint _price) public onlyOwner {
        price = _price;
    }


}
